INSERT INTO `HealthCode` VALUES (1,'08A','Facility not vermin proof. Harborage or conditions conducive to attracting vermin to the premises and/or allowing vermin to exist.'),(2,'04L','Evidence of mice or live mice present in facility\'s food and/or non-food areas.'),(3,'02B','Hot food item not held at or above 140º F.'),(4,'04N','Filth flies or food/refuse/sewage-associated (FRSA) flies present in facility’s food and/or non-food areas. Filth flies include house flies, little house flies, blow flies, bottle flies and flesh flies. Food/refuse/sewage-associated flies include fruit flies, drain flies and Phorid flies.'),(5,'10F','Non-food contact surface improperly constructed. Unacceptable material used. Non-food contact surface or equipment improperly maintained and/or not properly sealed, raised, spaced or movable to allow accessibility for cleaning on all sides, above and underneath the unit.'),(6,'02G','Cold food item held above 41º F (smoked fish and reduced oxygen packaged foods above 38 ºF) except during necessary preparation.'),(7,'20D','“Choking first aid” poster not posted. “Alcohol and pregnancy” warning sign not posted. Resuscitation equipment: exhaled air resuscitation masks (adult & pediatric), latex gloves, sign not posted. Inspection report sign not posted.'),(8,'09A','Canned food product observed dented and not segregated from other consumable food items.'),(9,'06E','Sanitized equipment or utensil, including in-use food dispensing utensil, improperly used or stored.'),(10,'06D','Food contact surface not properly washed, rinsed and sanitized after each use and following any activity when contamination may have occurred.'),(11,'06F','Wiping cloths soiled or not stored in sanitizing solution.'),(12,'16C','Caloric content not posted on menus, menu boards or food tags, in a food service establishment that is 1 of 15 or more outlets operating the same type of business nationally under common ownership or control, or as a franchise or doing business under the same name, for each menu item that is served in portions, the size and content of which are standardized.'),(13,NULL,NULL),(14,'08C','Pesticide use not in accordance with label or applicable laws. Prohibited chemical used/stored. Open bait station used.'),(15,'10B','Plumbing not properly installed or maintained; anti-siphonage or backflow prevention device not provided where required; equipment or floor not properly drained; sewage disposal system in disrepair or not functioning properly.'),(16,'06C','Food not protected from potential source of contamination during storage, preparation, transportation, display or service.'),(17,'10H','Proper sanitization not provided for utensil ware washing operation.'),(18,'04H','Raw, cooked or prepared food is adulterated, contaminated, cross-contaminated, or not discarded in accordance with HACCP plan.'),(19,'09C','Food contact surface not properly maintained.'),(20,'06A','Personal cleanliness inadequate. Outer garment soiled with possible contaminant.  Effective hair restraint not worn in an area where food is prepared.'),(21,'04C','Food worker does not use proper utensil to eliminate bare hand contact with food that will not receive adequate additional heat treatment.'),(22,'20F','Current letter grade card not posted.'),(23,'06B','Tobacco use, eating, or drinking from open container in food preparation, food storage or dishwashing area observed.'),(24,'16B','The original nutritional fact labels and/or ingredient label for a cooking oil, shortening or margarine or food item sold in bulk, or acceptable manufacturer’s documentation not maintained on site.'),(25,'05F','Insufficient or no refrigerated or hot holding equipment to keep potentially hazardous foods at required temperatures.'),(26,'04K','Evidence of rats or live rats present in facility\'s food and/or non-food areas.'),(27,'10A','Toilet facility not maintained and provided with toilet paper, waste receptacle and self-closing door.'),(28,'04A','Food Protection Certificate not held by supervisor of food operations.'),(29,'04M','Live roaches present in facility\'s food and/or non-food areas.'),(30,'02H','Food not cooled by an approved method whereby the internal product temperature is reduced from 140º F to 70º F or less within 2 hours, and from 70º F to 41º F or less within 4 additional hours.'),(31,'10I','Single service item reused, improperly stored, dispensed; not used when required.'),(32,'15F6',NULL),(33,'04E','Toxic chemical improperly labeled, stored or used such that food contamination may occur.'),(34,'02I','Food prepared from ingredients at ambient temperature not cooled to 41º F or below within 4 hours.'),(35,'05D','Hand washing facility not provided in or near food preparation area and toilet room. Hot and cold running water at adequate pressure to enable cleanliness of employees not provided at facility. Soap and an acceptable hand-drying device not provided.'),(36,'04O','Live animals other than fish in tank or service animal present in facility\'s food and/or non-food areas.'),(37,'22A','Nuisance created or allowed to exist. Facility not free from unsafe, hazardous, offensive or annoying conditions.'),(38,'09B','Thawing procedures improper.'),(39,'16D','Posted caloric content on the menu(s), menu board(s), food tag(s) or stanchions adjacent to menu boards for drive-through windows deficient, in that the size and/or font for posted calories is not as prominent as the name of the menu item or its price.'),(40,'16E','Caloric content range (minimum to maximum) not posted on menus and or menu boards for each flavor, variety and size of each menu item that is offered for sale in different flavors, varieties and sizes.'),(41,'10E','Accurate thermometer not provided in refrigerated or hot holding equipment.'),(42,'18D','Failure to comply with an Order of the Board of Health, Commissioner, or Department.'),(43,'04J','Appropriately scaled metal stem-type thermometer or thermocouple not provided or used to evaluate temperatures of potentially hazardous foods during cooking, cooling, reheating and holding.'),(44,'05C','Food contact surface improperly constructed or located. Unacceptable material used.'),(45,'22C','Bulb not shielded or shatterproof, in areas where there is extreme heat, temperature changes, or where accidental contact may occur.'),(46,'22G',NULL),(47,'04F','Food, food preparation area, food storage area, area used by employees or patrons, contaminated by sewage or liquid waste.'),(48,'03A','Food from unapproved or unknown source or home canned. Reduced oxygen packaged (ROP) fish not frozen before processing; or ROP foods prepared on premises transported to another site.'),(49,'10J','\"\"Wash hands” sign not posted at hand wash facility.'),(50,'05E','Toilet facility not provided for employees or for patrons when required.'),(51,'10D','Mechanical or natural ventilation system not provided, improperly installed, in disrepair and/or fails to prevent excessive build-up of grease, heat, steam condensation vapors, odors, smoke, and fumes.'),(52,'20A','Food allergy information poster not conspicuously posted where food is being prepared or processed by food workers.'),(53,'02A','Food not cooked to required minimum temperature.'),(54,'05H','No facilities available to wash, rinse and sanitize utensils and/or equipment.'),(55,'06G','HACCP plan not approved or approved HACCP plan not maintained on premises.'),(56,'06I','Food not labeled in accordance with HACCP plan.'),(57,'15F1',NULL),(58,'05A','Sewage disposal system improper or unapproved.'),(59,'10G','Food service operation occurring in room used as living or sleeping quarters.'),(60,'08B','Covered garbage receptacle not provided or inadequate, except that garbage receptacle may be uncovered during active use. Garbage storage area not properly constructed or maintained; grinder or compactor dirty.'),(61,'02C','Hot food item that has been cooked and refrigerated is being held for service without first being reheated to 1 65º F or above within 2 hours.'),(62,'20E','Letter Grade or Grade Pending card not conspicuously posted and visible to passersby.'),(63,'22F',NULL),(64,'15I','\"\"No Smoking” and/or \'Smoking Permitted” sign not conspicuously posted. Health warning not present on \'Smoking Permitted”'),(65,'03B','Shellfish not from approved source, improperly tagged/labeled; tags not retained for 90 days.'),(66,'04D','Food worker does not wash hands thoroughly after using the toilet, coughing, sneezing, smoking, eating, preparing raw foods or otherwise contaminating hands.'),(67,'03E','Potable water supply inadequate. Water or ice not potable or from unapproved source.  Cross connection in potable water supply system observed.'),(68,'15E2',NULL),(69,'10C','Lighting inadequate; permanent lighting not provided in food preparation areas, ware washing areas, and storage rooms.'),(70,'02D','Precooked potentially hazardous food from commercial food processing establishment that is supposed to be heated, but is not heated to 140º F within 2 hours.'),(71,'15L','Smoke free workplace smoking policy inadequate, not posted, not provided to employees.'),(72,'18F','Permit not conspicuously displayed.'),(73,'22E','ROP processing equipment not approved by DOHMH.'),(74,'15F7',NULL);
